// Importă modulul React și orice alte componente necesare
import React from 'react';
import { Layout, Menu } from 'antd';

// Extrage componente utile din Ant Design
const { Header, Content, Footer } = Layout;

// Definește componenta Layout
const MyLayout = () => {
    return (
        <Layout>
            <Header>
                {/* Antetul aplicației, inclusiv un meniu */}
                <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['1']}>
                    <Menu.Item key="1">Acasă</Menu.Item>
                    <Menu.Item key="2">Despre</Menu.Item>
                    <Menu.Item key="3">Contact</Menu.Item>
                </Menu>
            </Header>
            <Content style={{ padding: '0 50px' }}>
                {/* Conținutul principal al aplicației */}
                <div className="site-layout-content">
                    Conținutul aplicației va fi afișat aici.
                </div>
            </Content>
            <Footer style={{ textAlign: 'center' }}>
                {/* Subsolul aplicației */}
                My Footer
            </Footer>
        </Layout>
    );
};

// Exportă componenta Layout
export default MyLayout;
